style.css:
/* styles the body of the page */
body {
  font-family: Arial, sans-serif;
  background-color: #f4f4f4;
}

/* styles the paragraphs of the page */
p {
  margin-left: 20px;
}

/* styles headings on the page */
h1 {
  font-size: 2em;
  color: #333;
  margin-bottom: 10px;
}
h2 {
  font-size: 1.5em;
  color: #666;
  margin-bottom: 10px;
}

/* styles hyperlinks on the page */
a {
  color: #0074d9;
  text-decoration: none;
}
